@Shared_MM @tierscooters @okai_co @limebike Louis Vuitton, when they launched a range of Perfumes, they also came up with a "refilling" program.

If you buy a perfume for ~€300, you don't have to buy a new bottle next time, but you can bring the empty bottle and refill for ~€180.

You can imagine what happened 😉

